  void onButtonClick(BuildContext context, String? b, String? d) {
    int bags = int.parse(bagsTextController.text);
    int weight = int.parse(weightTextController.text);

    RequestData r = context.read<AppModel>().request!;
    r.bagTotalWeight = weight;
    r.checkNumBags = bags;
    r.carrier1 = Carrier("Sean", "123", "(896) 402-1331",
        DateTime.now().subtract(Duration(days: 9126)));
    r.carrier2 = Carrier("Stephanie", "321", "(260) 151-4896",
        DateTime.now().subtract(Duration(days: 13126)));
    r.carrier2!.photo =
        "";
    Database.setRequest(r);
    locator.get<AppModel>().updateAirport(b, d);

    Navigator.of(context)
        .push(MaterialPageRoute(builder: (context) => CarrierScreen()));
  }
